            "carry_std": carry_std,
            "lateral_std": lateral_std,
            "last_updated": now,
            "confidence": confidence.value,
        }
    return aggregates


def _classify_confidence(sample_count: int, carry_std: float) -> Confidence:
    if sample_count >= 200 and carry_std <= 10:
        return Confidence.HIGH
    if sample_count >= 120 and carry_std <= 15:
        return Confidence.MEDIUM
    return Confidence.LOW


def wind_effect(speed_mps: float, direction_deg: float) -> dict[str, float]:
    """Return carry delta and lateral margin induced by wind."""
    normalized = direction_deg % 360
    signed = ((direction_deg + 180) % 360) - 180  # map to [-180, 180)

    cos_theta = math.cos(math.radians(normalized))
    sin_theta = math.sin(math.radians(normalized))

    is_tailwind = signed < 0 or 90 < normalized < 270
    if is_tailwind:
        carry_delta = -speed_mps * abs(cos_theta) * TAILWIND_COEFFICIENT
    else:
        carry_delta = speed_mps * abs(cos_theta) * HEADWIND_COEFFICIENT

